import { Icon } from 'semantic-ui-react'
import React from 'react';


const Marker = ({lat, lng}) => {
    return(
        <div className= 'marker'>
           <Marker 
                 key = {d.id}
                 lat = {d.latitude}
                lng = {d.longitude}
                text="my marker"
                fontColor="red"
    />
        </div>
    )
}

export default Marker
